import { Outlet } from 'react-router-dom';
import DerwolfGroupNavbar from '../DerwolfGroup/components/DerwolfGroupNavbar';
import DerwolfGroupFoo from '../DerwolfGroup/components/DerwolfGroupFooter';

function DerwolfGroupLayout() {
  return (
    <>
      <DerwolfGroupNavbar />
      <Outlet />
      <Footer />
    </>
  );
}

export default DerwolfGroupLayout;
